char s[1024+1];
char *hex(unsigned char *pBuff, int buff_len, int offset, int datasize )
{
    memset(s, 0x00, 1024+1);
    int idx = 1023 ;

    if ( datasize >= 8 ) s[idx--] = 'L';
    if ( datasize >= 8 ) s[idx--] = 'L';
    if ( datasize >= 4 ) s[idx--] = 'U';

    int i = 0 ;
    for ( i = 0 ; i < datasize ; i ++ )
    {
        if ( offset + i < buff_len )
        {
            s[idx - 1] = (pBuff[offset + i] >> 4 ) & 0xF ;
            s[idx ] = (pBuff[offset + i] ) & 0xF ;
        }

        if ( s[idx - 1] >= 10 ) s[idx - 1] += 'A' - 10;
        else s[idx - 1] += '0';

        if ( s[idx] >= 10 ) s[idx] += 'A'- 10;
        else s[idx] += '0';
        idx -= 2;
    }
    s[idx ] = 'x';
    s[idx - 1] = '0';
    return (char *)(s + idx - 1) ;
}

// generate_data header
void print_variable(FILE *fout, const char *name, unsigned int offset, int length, int datasize)
{

    unsigned char *pBuff = new unsigned char [ length * datasize] ;
    unsigned char *p = pBuff ;
    const char *type = "";
    int new_line = 16 ;
    if ( datasize == 1 ) new_line = 16 ;
    if ( datasize == 2 ) new_line = 12 ;
    if ( datasize == 4 ) new_line = 7 ;
    if ( datasize == 8 ) new_line = 4 ;

    FILE *fin = fopen("libgame.so", "rb");
    fseek(fin, offset, SEEK_SET);
    fread(pBuff, 1, length * datasize, fin);
    fclose(fin);

    if ( datasize == 1 ) type = "_BYTE";
    else if ( datasize == 2 ) type = "_WORD";
    else if ( datasize == 4 ) type = "_DWORD";
    else if ( datasize == 8 ) type = "_QWORD";


    fprintf(fout, "\n// name=[%s], offset[0x%08X (%d)], length[0x%08X (%d)]\n", name, offset, offset, length, length);
    fprintf(fout, "%s %s[%d] = {", type, name, length / datasize );
    for ( int i = 0 ; i < length / datasize; i ++ )
    {
        if ( i % new_line == 0 ) 
        {
            if ( i ) 
            {
                fprintf(fout, "// %d ~ %d", i-new_line+1, i);
            }
            fprintf(fout, "\n    ");
        }

        fprintf(fout, "%s", hex(pBuff, length , i * datasize, datasize));

        if ( i != length - 1 ) printf(", ");
    }
    fprintf(fout, "  // %d ~ %d", length / datasize - (length%new_line == 0 ? new_line : length%new_line) + 1, length / datasize);
    fprintf(fout, "\n};\n");
}

// dump http key
void print_test_variable(FILE *fout, const char *name, unsigned int offset, int length, int datasize, TSBINARY *pBuff)
{
    TSBINARY decoded;
    pBuff->clear();
    pBuff->resize(length + 1 );
    FILE *fin = fopen("inc/libgame.so", "rb");
    fseek(fin, offset, SEEK_SET);
    fread(pBuff->data(), 1, length + 1, fin);
    fclose(fin);

    decode_key(pBuff, &decoded);

    fprintf(fout, "\n// name=[%s], offset[0x%08X (%d)], length[0x%08X (%d)], str : %s", name, offset, offset, length, length, decoded.data() );
    fprintf(fout, "\n, param{\"%s\", %d, \"", name, length-1);
    for ( int i = 0 ; i < length ; i ++ )
        fprintf(fout, "\\%s", hex(pBuff->data(), length * datasize, i * datasize, datasize)+1);
    fprintf(fout, "\"}");
}

void dump_aes_data()
{
    FILE *fp = stdout ;

    print_variable(fp, "T5", 0x02A0A4F8, 0x400, 8);
    print_variable(fp, "T1", 0x02A0A4FB, 0x400, 8);
    print_variable(fp, "T6", 0x02A0A8F8, 0x400, 8);
    print_variable(fp, "T2", 0x02A0A8FA, 0x400, 8);
    print_variable(fp, "T3_2", 0x02A0ACF8, 0x400, 8);
    print_variable(fp, "T3", 0x02A0ACF9, 0x400, 8);
    print_variable(fp, "T4", 0x02A0B0F8, 0x400, 8);
    print_variable(fp, "rcon", 0x02A0B4F8, 0x28, 4);
}

