void decompress()
{
    _BYTE buff[1024*10];
    FILE *fp = fopen("inc/Packages.xml", "rb");
    TSBINARY data, out;
    unsigned int n = fread(buff, 1, sizeof(buff), fp );
    fclose(fp);

    ts_decompress(buff, n, &out);
    printf("%s\n", out.data());
}

