// rotate left
template<class T> T __ROL__(T value, int count)
{
    const uint nbits = sizeof(T) * 8;

    if ( count > 0 )
    {
        count %= nbits;
        T high = value >> (nbits - count);
        if ( T(-1) < 0 ) // signed value
            high &= ~((T(-1) << count));
        value <<= count;
        value |= high;
    }
    else
    {
        count = -count % nbits;
        T low = value << (nbits - count);
        value >>= count;
        value |= low;
    }
    return value;
}

inline _BYTE  __ROL1__(_BYTE  value, int count) { return __ROL__((_BYTE)value, count); }

